class ColorMap {
    constructor() {
        this.SSPI = "#FFD54F"
        this.SUS = "#28a745"
        this.MS = "#ff851b"
        this.PG = "#007bff"
        this.colors = {
            SSPI: "#FFD54F",
            SUS: "#28a745",
            MS: "#ff851b",
            PG: "#007bff",
            ...customCountryColors
        }
    }

    get(entity) {
        if (this.colors[entity] === undefined) {
            return this.random();
        }
        return this.colors[entity]
    }
    
    random() {
        const keys = Object.keys(this.colors);
        const randomKey = keys[Math.floor(Math.random() * keys.length)];
        return this.colors[randomKey];
    }
}
